import React from 'react';
import './QuestionSummaryItem.css';

const questionSummaryItem = props => {
    return (
        <div className="QuestionItem">
            <div className="QuestionItemText">
                <p className="QuestionParagraph">{props.question}</p>
            </div>
            <div className="QuestionItemAnswers">
                {props.answers} <br></br>
                <p style={{fontSize:'12px', padding:'0px'}}>respostas</p>
            </div>
        </div>
    );
};

export default questionSummaryItem;
